import React from 'react'
import {Text} from 'react-native'

const CommitteesTab =()=>{
    const [committees, setCommittees]=useState
    useEffect(() => {
        const ref = db.collection("savekarlo");
        ref.onSnapshot((query) => {
          const objs = [];
          query.forEach((doc) => {
            objs.push({
              id: doc.id,
              ...doc.data(),
            });
          });
          setMembers(objs);
        });
      }, []);

return (
<Text>

    CommiteesTab
</Text>


)



}

export default CommitteesTab;
